INSERT INTO `area` VALUES (1,'稳汇率工具箱储备足 业界预计人民币汇率下半年或重回升值通道','2023-07-04 09:39','中国日报财经','中国外汇交易中心数据显示，7月3日，人民币对美元汇率中间价报7.2157，较前一交易日调升101个基点。展望下半年人民币汇率走势，业界普遍认为，短期看，人民币汇率或仍有所承压，但下半年重回升值通道为大概率事件。2023-07-0409:39','//caijing.chinadaily.com.cn/a/202307/04/WS64a37126a310ba94c5614b11.html','df192a0f266bfe8656aa118e3e3b18f4'),(2,'【瞰全球】市场“疲软”消费“乏力”，美国经济衰退即将来临','2023-06-30 15:36','中国日报财经','银行家和分析师认为，美国经济衰退的风险正在急剧增加，高利率正是造成困境的最大“罪魁祸首”。需要更多流动性的公司或已经背负巨额债务需要再融资的公司都面临着高昂的新债务成本。2023-06-3015:36','//caijing.chinadaily.com.cn/a/202306/30/WS649e7e91a310ba94c5614464.html','c951db563a3230992bcee336ff6aa641'),(3,'继续深耕中国市场 外企对在华发展充满信心','2023-06-30 15:59','中国日报财经','多位外企高管在夏季达沃斯论坛等多个场合纷纷表示，对中国经济发展前景充满信心，愿继续深耕中国市场、投资中国，加强在中国的业务布局。2023-06-3015:59','//caijing.chinadaily.com.cn/a/202306/30/WS649e8409a310ba94c5614481.html','3b7484d6dbfd6d11ff3d33151782155a'),(4,'美财政部部长耶伦将访华','2023-07-03 09:40','中国日报财经','经中美双方商定，美财政部部长珍妮特·耶伦将于7月6日至9日访华。2023-07-0309:40','//caijing.chinadaily.com.cn/a/202307/03/WS64a2210aa310ba94c56147f2.html','6ac79157d4a93ca1838625e0cfde8a09'),(5,'数字人民币覆盖多城住房公积金业务场景','2023-07-03 09:38','中国日报财经','2023年已过半，数字人民币住房公积金领域应用迎来多项突破性进展。6月19日，广州住房公积金管理中心使用数字人民币发放首批贷款，标志着广州实现住房公积金缴存、提取、贷款等主要业务场景数字人民币应用全覆盖。2023-07-0309:38','//caijing.chinadaily.com.cn/a/202307/03/WS64a22116a310ba94c56147f8.html','4401c8174880d8893bc1f43c31655b05'),(6,'咖啡市场规模有望突破万亿元 各路资本积极抢抓咖啡经济风口','2023-07-03 09:44','中国日报财经','6月30日晚间，央视财经报道，今年4月份至6月份，国内咖啡团购订单量大涨250%，专家预计全国咖啡市场规模2025年或突破1万亿元。”　　咖啡市场规模的不断扩大，也引来各路资本积极入局，通过完善配套设施、踊跃创业融资、成立风投基金、延伸产业链条等方式，抢抓咖啡经济风口。2023-07-0309:44','//caijing.chinadaily.com.cn/a/202307/03/WS64a22116a310ba94c56147f7.html','fc9708a2166662d3bb3e22fd480a772f'),(7,'资本市场不断释出开放信号 下半年外资料延续回流态势','2023-07-03 09:45','中国日报财经','推进资本市场对外开放的政策信号近期持续释放。多家外资机构认为，在多重利好因素推动下，外资有望在下半年延续回流趋势，A股下半年表现有望优于上半年。展望下半年，黄森玮认为，在估值到位、政策发力、补涨三大因素支持下，A股下半年表现有望优于上半年。2023-07-0309:45','//caijing.chinadaily.com.cn/a/202307/03/WS64a22116a310ba94c56147f6.html','41cf30bf7105acd4d81762aee39e5acf'),(8,'5G规模应用还需迈过几道坎','2023-07-03 09:45','中国日报财经','在日前召开的2023上海世界移动通信大会上，关于5G的讨论仍是焦点。从“建得好”向“用得好”升级，5G应用在成本、投资、覆盖、融合等方面仍面临很大挑战，首当其冲的就是5G投资回报比问题。2023-07-0309:45','//caijing.chinadaily.com.cn/a/202307/03/WS64a22116a310ba94c56147f5.html','421af60802e2c30b3b4fed510c6e5a4d'),(9,'前5个月全国港口吞吐量超67亿吨','2023-07-01 15:12','中国日报财经','今年1至5月，全国完成集装箱吞吐量1.22亿标准箱，同比增长4.8%。2023-07-0115:12','//caijing.chinadaily.com.cn/a/202307/01/WS649fcac9a310ba94c561462a.html','54fb599ec6c9fed789a74b0aa4252525'),(10,'重启全球增长，中国作出表率','2023-07-01 15:13','中国日报财经','近期，多家国际机构上调中国经济增长预测，寄望中国成为全球经济增长的关键动力。中国经济今年逆势而上，已成为全球经济的一大亮点。2023-07-0115:13','//caijing.chinadaily.com.cn/a/202307/01/WS649fcac9a310ba94c561462b.html','b705d2e0ef620b16c787e0abfdbd2939'),(11,'【全球市场晚报】7月6日','2023-07-06 17:03','中国日报财经','2023-07-0617:03','//caijing.chinadaily.com.cn/a/202307/06/WS64a67bf8a310ba94c5615269.html','f1026eff77baa26c7420ea442019ac43'),(12,'“AI诈骗”多发 完善监管体系迫在眉睫','2023-07-06 15:08','中国日报财经','专家认为，随着人工智能技术的发展，不法分子利用AI实施诈骗的精准性、隐蔽性进一步增强，需高度警惕。人工智能安全治理需多方协力，完善监管体系迫在眉睫。2023-07-0615:08','//caijing.chinadaily.com.cn/a/202307/06/WS64a66186a310ba94c56151df.html','00af37f40cbe4c63acd7919e6f58728a'),(13,'夏管关键期　农田绘“丰”景——多地农业生产一线扫描','2023-07-06 15:07','中国日报财经','在山东省淄博市桓台县新城镇河南村党支部领办的合作社内，980亩小麦已经完成收获，平均亩产达1100斤。针对近日的高温少雨天气，山东省淄博市桓台县新城镇河南村党支部领办的合作社为玉米打开了喷灌设备，造墒降温。2023-07-0615:07','//caijing.chinadaily.com.cn/a/202307/06/WS64a6619ea310ba94c56151e1.html','50f336c475ac4dcc0d694854e617331f'),(14,'6月份中国大宗商品指数102.8% 供需双侧联动上扬','2023-07-06 15:07','中国日报财经','7月5日，中国物流与采购联合会发布数据显示，6月份中国大宗商品指数为102.8%，较上月上升2.1个百分点，已连续两个月上升。“随着国内经济温和复苏，加之需求恢复以及生产利润有所修复，生产企业对后市预期良好，生产热情高涨，国内大宗商品市场供应量持续增加，供应压力不断加大。2023-07-0615:07','//caijing.chinadaily.com.cn/a/202307/06/WS64a6619fa310ba94c56151e2.html','1487e3365af6b3650b1c38f31182ade3'),(15,'促消费信号密集释放 新举措加快出台','2023-07-06 15:09','中国日报财经','随着旅游消费升级和夜经济的兴起，不夜城成为不少地方探索发展夜游文旅的模式，也是地方优化供给、激活消费潜力的手段之一。中国贸促会研究院副院长赵萍认为，促进大宗消费，有助于带动消费供给端修复，带动更大规模的就业和更稳定的收入增长。2023-07-0615:09','//caijing.chinadaily.com.cn/a/202307/06/WS64a661a2a310ba94c56151e4.html','e287ac22c69fb5